import React from 'react'

const Header = () => {
  return (
    <div className="conainter">
        <div className="a">
            <h3>Notes</h3>
        </div>

        <div className="b">
            <NoteButton 
              toggleDisplayNotes={this.toggleDisplayNotes}
              pageType={'new'}
            />
        </div>

    </div>
  )
}

export default Header
